ConstValues.value:
"function post(command, params = {}) {
    window.webkit.messageHandlers.wortise.postMessage({ ...params, command });
}

window.Wortise = {
    close: function() {
        post('close');
    },

    open: function(url) {
        post('open', { url });
    },

    showClose: function() {
        post('showClose');
    }
};"
